import React, { Component } from "react";
import "../Test/Test.css";
import { Link, NavLink } from "react-router-dom";
import axios from "axios";
import authService from "../../services/auth-service";
import axiosService from "../../services/axios-service";
import { API_URL } from "../../services/url";
import SimpleReactValidator from "simple-react-validator";
import { SuccessModal } from "../Test/SuccessModal";
export class AT4 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      btnstatus : false,
      supplier: "",
      source: "",
      weight: "",
      size:  "",
      rock_type : "",
      agg_type: "",
      pto_comment: "",
      total: "",
      amount_status: false,
      type: "AT_4",
      plant: localStorage.getItem("plant_name"),
      date: "",
      s_t1: "",
      s_t2: "",
      s_t3: "",
      s_t4 : "",s_t5 : "",s_t6 : "",s_t13: "",s_t14 : "",s_t15 : "",s_t16 : "",s_t17 : "",s_t18:"",s_t19 : '',s_t20 : "",s_t21 : "",s_t22 : "",s_t23 : "",s_t24  :"", s_t25  : "",s_t26 : "",s_t27  : "",s_t28 : "",s_t29 : "",s_t30 : "",s_t31  :"",s_t32  : "",s_t33 : "",s_t34 : "",s_t35 : "",s_t36 : "",
      result1  : "",
      result2  : "",
      result3  : "",
      result4  : "",
      result5  : "",
      result6  : "",
      result7  : "",
      result8  : "",
      result9  : "",
      result10  : "",
      result11  : "",
      result12  : "",
      result13  : "",
      result14  : "",
      result15  : "",
      result16  : "",
      result17  : "",
      result18  : "",
      result19  : "",
     result20  : "",
     result21  : "",
    result22  : "",
    result23  : "",
    result24  : "",
     result25  : ""   };
    this.onSubmit = this.onSubmit.bind(this);
    this.validator = new SimpleReactValidator();
  }
  componentWillMount = () => {
    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth() + 1; //January is 0!
    var yyyy = today.getFullYear();

    if (dd < 10) {
      dd = "0" + dd;
    }

    if (mm < 10) {
      mm = "0" + mm;
    }

    today = mm + "/" + dd + "/" + yyyy;
    console.log("date here", today);
    this.state.date = today;
    console.log(this.state.date);


    //for loop experiment
    for(let i=1;i<=25;i++)
    {
      console.log('result',i,' : ""')
    }
  };
  openModal() {
    this.setState({
        visible : true
    });
}

  closeModal() {
    this.setState({
        visible : false
    });
  }
  change = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };
  getWebsite = () => {
    fetch("/").then(console.log(this.state));
  };
  async onSubmit(event) {
    event.preventDefault();
    console.log(this.state);
    if (this.validator.allValid()) {
      let tokenvalue = localStorage.getItem("token");
      this.openModal();
      this.setState({
        btnstatus : true
      })
      try {
        const response = await axios.post(
          `${API_URL}rf_form/submit`,
          this.state,
          (axios.defaults.headers.common["x-access-token"] = tokenvalue)
        );
        console.log(response);
        //   .then(console.log(this.state));

          if (response.data==='success') {
            // alert(response.data);
            this.props.history.push("/ViewAT4");
          } else {
            alert(response.data);
          }
      } catch (error) {
        console.log(error);
      }
    } else {
      this.validator.showMessages();
      // rerender to show messages for the first time
      this.forceUpdate();
    }
  }
  totalshow = e => {
    e.preventDefault();
    let total_sample_sieving = this.state.weight_sample_sieving;
    let total_sample_testing = this.state.weight_sample_testing;
    let total_amount =
      ((total_sample_testing - total_sample_sieving) / total_sample_testing) *
      100;
    this.state.total = total_amount;
    console.log(total_amount);
    this.setState({
      amount_status: true
    });
  };
  render() {
         // let showmodal;
         let sbmtbtn, btnmsg;
         if(this.state.visible)
         {
           // showmodal = (
           //   <div>
           //     <SuccessModal  
           //          visible={this.state.visible}
           //               width={this.props.width}
           //               height={this.props.height}
           //               effect={this.props.effect}
           //               onClickAway={() => this.closeModal()} />
           //   </div>
           // )
         }
         if(this.state.btnstatus)
         {
           sbmtbtn = (
             <button
             class="btn btn-primary"
             onClick={this.onSubmit.bind(this)}
             disabled
           >
             Submit
           </button>
           )
           btnmsg = (
             <div>
             <hr />
             <p>Your Form Has Already Been Submitted.Please Don't Click SUMBIT Button AGAIN!!</p>
             </div>
           )
         }
         else
         {
           sbmtbtn=(
             <button
             class="btn btn-primary"
             onClick={this.onSubmit.bind(this)}
           >
             Submit
           </button>
           )
         }
    let display_total_amount;
    if (this.state.amount_status == true) {
      display_total_amount = <div>{this.state.total} %</div>;
    } else {
      display_total_amount = (
        <div>
          <p>Enter The Above Fields</p>
        </div>
      );
    }

    return (
      <div className="skin-blue fixed-layout">
        <div className="page-wrapper">
          <div className="container-fluid">
            <div className="row page-titles">
              <div className="col-md-5 align-self-center">
                {/* <h4 className="text-themecolor">Forms</h4> */}
                <nav aria-label="breadcrumb">
                  <ol class="breadcrumb">
                    <li className="breadcrumb-item">
                      <Link to={process.env.PUBLIC_URL + "/"}>Home</Link>
                    </li>
                    <li className="breadcrumb-item active" aria-current="page">
                      AT - 04
                    </li>
                  </ol>
                </nav>
              </div>
            </div>
          </div>

          {/*Form content begin */}

          <div className="product-form-upper">
            <div className="container-fluid">
              <div className="below-custom-form">
                <div className="row">
                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <p style={{ textAlign: "center" }}>
                      <h3>AT -04</h3>
                      RM Approval Document for Aggregates BOSQC : 2018 – PT17
                    </p>
                    <hr />
                  </div>
                </div>
                <form className="custom-content-form">
                  <div className="form-row">
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Plant
                        </label>
                        <div class="col-sm-10">
                          {localStorage.getItem("plant_name")}
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Date Of Receipt
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="date"
                            class="form-control"
                            id="inputPassword"
                            name="date"
                            value={this.state.date}
                            onChange={e => this.change(e)}
                          />
                          <span className="text-danger">
                        {this.validator.message(
                          "date of receipt",
                          this.state.date,
                          "required"
                        )}
                      </span>
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Size
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="size"
                            value={this.state.size}
                            onChange={e => this.change(e)}
                          />
                          <span className="text-danger">
                        {this.validator.message(
                          "size",
                          this.state.size,
                          "required"
                        )}
                      </span>
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputSubcategory"
                          className="col-sm-2 col-form-label"
                        >
                          Supplier
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="supplier"
                            value={this.state.supplier}
                            onChange={e => this.change(e)}
                          />
                          <span className="text-danger">
                        {this.validator.message(
                          "supplier",
                          this.state.supplier,
                          "required"
                        )}
                      </span>
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Source
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="source"
                            value={this.state.source}
                            onChange={e => this.change(e)}
                          />
                          <span className="text-danger">
                        {this.validator.message(
                          "source",
                          this.state.source,
                          "required"
                        )}
                      </span>
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Rock Type
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="rock_type"
                            value={this.state.rock_type}
                            onChange={e => this.change(e)}
                          />
                          <span className="text-danger">
                        {this.validator.message(
                          "rock type",
                          this.state.rock_type,
                          "required"
                        )}
                      </span>
                        </div>
                      </div>
                    </div>
                  </div>
                  {/* <small>* This Fields are Mandatory . </small> */}
                  {/* <br />
                                  <button
                                    class="btn btn-primary"
                                    onClick={this.onSubmit.bind(this)}
                                  >
                                    Submit
                                  </button> */}
                </form>
              </div>
              {/*etst detial form */}
              <div className="below-custom-form">
                <div className="row">
                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <h3>Test Conducted On Sample</h3>
                    <hr />
                    <br />
                  </div>
                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <h4>Gradation For CA</h4>
                    <hr />
                  </div>
                </div>
                <form className="custom-content-form">
                  <div className="form-row">
                    <div class="form-group col-md-12">
                      <table class="table table-bordered">
                        <thead class="thead-light">
                          <tr>
                            <th scope="col">Test</th>
                            <th scope="col">Result</th>
                            <th scope="col">Result Within Range</th>
                          </tr>
                        </thead>
                        <tbody>
                          <tr>
                            <th scope="row">% passing on 20mm sieve </th>

                            <td>
                              <input
                                type="text"
                                className="form-control"
                                name="s_t1"
                                value={this.state.s_t1}
                                onChange={e => this.change(e)}
                              />
                            </td>
                            <td>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="Yes"
                              name="result1"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox1"
                                >
                                  Yes
                                </label>
                              </div>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="No"
                              name="result1"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox2"
                                >
                                  No
                                </label>
                              </div>
                            </td>
                          </tr>
                          <tr>
                            <th scope="row">% passing on 12.5mm sieve </th>

                            <td>
                              <input
                                type="text"
                                className="form-control"
                                name="s_t2"
                                value={this.state.s_t2}
                                onChange={e => this.change(e)}
                              />
                            </td>
                            <td>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
