                              name="result2"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox1"
                                >
                                  Yes
                                </label>
                              </div>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="No"
                              name="result2"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox2"
                                >
                                  No
                                </label>
                              </div>
                            </td>
                          </tr>
                          <tr>
                            <th scope="row">% passing on 10mm sieve </th>

                            <td>
                              <input
                                type="text"
                                className="form-control"
                                name="s_t3"
                                value={this.state.s_t3}
                                onChange={e => this.change(e)}
                              />
                            </td>
                            <td>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="Yes"
                              name="result3"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox1"
                                >
                                  Yes
                                </label>
                              </div>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="No"
                              name="result3"
                              onClick={e => this.change(e)}
                            />
                                <label
                                  class="form-check-label"
                                  for="inlineCheckbox2"
                                >
                                  No
                                </label>
                              </div>
                            </td>
                          </tr>
                          <tr>
                            <th scope="row">% passing on 4.75mm sieve </th>

                            <td>
                              <input
                                type="text"
                                className="form-control"
                                name="s_t4"
                                value={this.state.s_t4}
                                onChange={e => this.change(e)}
                              />
                            </td>
                            <td>
                              <div class="form-check form-check-inline">
                              <input
                              className="form-check-input"
                              type="radio"
                              id="inlineCheckbox1"
                              value="Yes"
                              name="result4"
                              onClick={e => this.change(e)}
                            />
                                <label
